<?php/* *  * AJAX dynamic shopdock (jquery) */if( !function_exists( 'get_dynamic_shopdock' ) ) {    function get_dynamic_shopdock() {        global $woocommerce;                get_template_part( 'includes/shopdock' );        die();    }    add_action( 'wp_ajax_nopriv_get_dynamic_shopdock', 'get_dynamic_shopdock' );    add_action( 'wp_ajax_get_dynamic_shopdock', 'get_dynamic_shopdock' );}?>